import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './components/Navigation';

const Home = () => <h1>Home</h1>;
const Introduction = () => <h2>Introduction</h2>;
const VariablesDataTypes = () => <h2>Variables and Data Types</h2>;
const OperatorsExpressions = () => <h2>Operators and Expressions</h2>;
const ConditionalExpressions = () => <h2>Conditional and Expressions</h2>;
const Cycles = () => <h2>Cycles</h2>;
const Functions = () => <h2>Functions</h2>;
const Strings = () => <h2>Strings</h2>
const ListsAndTuples = () => <h2>Lists and tuples</h2>
const DictsAndSets = () => <h2>Dictionaries and sets</h2>
const Libraries = () => <h2>Libraries</h2>
const ClassesAndObjects = () => <h2>Classes and objects</h2>
const AdvancedOOP = () => <h2>Advanced OOP</h2>


const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/introduction" element={<Introduction />} />

        <Route path="/python-basics/variables-and-data-types" element={<VariablesDataTypes />} />
        <Route path="/python-basics/operators-and-expressions" element={<OperatorsExpressions />} />

        <Route path="/conditional-and-cycles/conditional-expressions" element={<ConditionalExpressions />} />
        <Route path="/conditional-and-cycles/cycles" element={<Cycles />} />

        <Route path="/functions" element={<Functions />} />

        <Route path="/dataTypes/strings" element={<Strings />} />
        <Route path="/dataTypes/lists-and-tuples" element={<ListsAndTuples />} />
        <Route path="/dataTypes/dicts-and-sets" element={<DictsAndSets />} />

        <Route path="/libraries" element={<Libraries />} />

        <Route path="/oop/classes-and-objects" element={<ClassesAndObjects />} />
        <Route path="/oop/advanced-OOP" element={<AdvancedOOP />} />
      </Routes>
    </Router>
  );
};

export default App;
